2025: Abona $1175  Abono 5a  de 18; se anota al credito de Erika Mejia  #57\r\n14) Item 19: Abril 17-2025, Abona 1 Millon, Se completa 5a cuota de 18. Se anota al credito de Erika Mejia Tarjeta #57.\r\n15)Mayo 26-2025:  Abono $1.175; Abono se realiza a la Tarjeta #58 de Fredy Esposo Erika Mejia; Se abona a la 6a Cuota de 18; Pendiente 1 Millon de la cuota 6\r\n16) Junio 24-2025: Abono $1 Millon, Abono se realiza a la tarjeta #58 de Fredy Esposo Erika Mejia; Se abona el millon pendiente de la cuota 6. Cuotas pagas en su totalidad 6\r\n\r\n\r\n'),
